SELECT pgr_createTopology('routing.road_line_noded', 0.1, 'geom');
SELECT pgr_analyzeGraph('routing.road_line_noded', 0.1, 'geom'); Running the functions shown above will create two (2) new tables usable for routing. routing.road_line_noded routing.road_line_noded_vertices_pgr

