The route shown in the previous example now respects the access control and limits to routes suitable for motorized traffic. It, however, did not respect the one-way access control. The very first segment (top-left corner of screenshot) went the wrong way on a one-way street. This behavior is a result of the simple length-based cost model. The oneway column in the road tables uses osm2pgsql's direction data type which resolves to int2 in Postgres. Valid values are: 0: Not one way 1: One way, forward travel allowed -1: One way, reverse travel allowed NULL: It's complicated. See #172. Assuming a noded roads table routing table, bring over the oneway detail ALTER TABLE routing.road_line_noded ADD oneway INT2 NULL
; UPDATE routing.road_line_noded rn SET oneway = r.oneway FROM routing.road_line r WHERE rn.old_id = r.id AND rn.oneway IS NULL
;

